import React from 'react';

import {
  Container,
  ContentContainer,
  TitleContainer,
  SubTitle,
  ImageContainer,
  thumbanailProject,
  thumbanail_link,
  thumbanail_image,
} from './styles';

const Project: React.FC = () => {
  return (
    <Container>
      <ContentContainer>
        <TitleContainer>Projects</TitleContainer>
        <SubTitle>
          Aqui estão alguns dos meus trabalhos, foram realizados em torno de 182
          projetos. Separei alguns dos projetos próprios ou realizados em
          parceria nessa sessão
        </SubTitle>
        <ImageContainer>
          <thumbanailProject></thumbanailProject>
        </ImageContainer>
      </ContentContainer>
    </Container>
  );
};

export default Project;
